  false,\n\t\"url\": null,\n\t\"notes\": \"PAHs and AHs were not detected in any of
  the water samples collected. However, the compounds were detected in the sediment
  samples (Table l and Appendix A). Concentrations of total PAHs, total carcinogenic
  PAHs, and total AHs in the sediment samples were low at each site except sites 17
  and 18, which had elevated levels of PAHs and AHs. Total PAHs include all of the
  concentrations of individual PAHs found in a sediment sample. Total carcinogenic
  PAHs include only the concentrations of heavier PAHs that have been known to produce
  cancerous tumors in animals. The total AHs include all of the concentrations of
  individual AHs found in the sediment samples (Appendix A). Conductivity and turbidity
  exhibited the greatest variation of the water quality parameters measured on Felsenthal
  NWR and adjacent areas (Table 2). Highest values for both conductivity and turbidity
  were found at site 17 outside the refuge boundaries. The lowest values were found
  in L'Aigle Creek (site 6) outside the boundaries of the refuge.\",\n\t\"license_title\":
